INSERT INTO oc_perennial.product_or_service_code
(code, description, start_date, final_date, full_description, excludes, notes, includes)
values
('10', 'WEAPONS', to_date('10/01/1979', 'MM/DD/YYYY'), NULL, NULL, NULL, 'This group includes combat weapons as well as weapon-like noncombat items, such as line throwing devices and pyrotechnic pistols.  Also included in this group are weapon neutralizing equipment, such as degaussers, and deception equipment, such as camouflage nets.  Excluded from this group are fire control and night devices classifiable in groups 12 or 58.', NULL),
('1000', NULL, to_date('12/12/2003', 'MM/DD/YYYY'), '10/01/2006', NULL, NULL, NULL, NULL),
('1005', 'GUNS, THROUGH 30MM', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Guns, through 30 mm', 'Turrets, Aircraft.', NULL, 'Machine guns; Brushes, Machine Gun and Pistol.'),
('1010', 'GUNS, OVER 30MM UP TO 75MM', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Guns, over 30 mm up to 75 mm', NULL, NULL, 'Breech Mechanisms; Mounts Grenade Launchers for Integral-Cartridge Grenades, Single-Shot or Auto-Loading or Automatic-Firing.'),
('1015', 'GUNS, 75MM THROUGH 125MM', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Guns, 75 mm through 125 mm', NULL, NULL, 'Breech Mechanisms; Mounts; Rammers.'),
('1020', 'GUNS, OVER 125MM THROUGH 150MM', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Guns, over 125 mm through 150 mm Includes Breech Mechanisms, Power Drives; Gun Shields.', NULL, NULL, NULL),
('1025', 'GUNS, OVER 150MM THROUGH 200MM', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Guns, over 150 mm through 200 mm Includes Firing Platforms; Mounts; Gun Shields.', NULL, NULL, NULL),
('1030', 'GUNS, OVER 200MM THROUGH 300MM', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Guns, over 200 mm through 300 mm Includes Gun Yokes; Rammers; Reflectors.', NULL, NULL, NULL),
('1035', 'GUNS, OVER 300MM', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Guns, over 300 mm', NULL, NULL, 'Breech Mechanisms; Training Gears; Power Drives.'),
('1040', 'CHEMICAL WEAPONS AND EQUIPMENT', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Chemical Weapons and Equipment', NULL, NULL, 'Flame Throwers; Smoke Generators.'),
('1045', 'LAUNCHERS, TORPEDO AND DEPTH CHARGE', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Launchers, Torpedo and Depth Charge', NULL, NULL, 'Depth Charge Tracks; Torpedo Tubes.'),
('1055', 'LAUNCHERS, ROCKET AND PYROTECHNIC', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Launchers, Rocket and Pyrotechnic', 'Specifically designed Airborne Guided Missile  Launchers; Jettisonable Rocket Launchers; Launcher Fairings designed for specific airframes; Rifle Grenade Launchers; Grenade Launchers for Integral-Cartridge Grenades, Single-Shot or Auto Loading or Automatic Firing.', NULL, 'Airborne Rocket Launchers adaptable to guided missile use.'),
('1070', 'NETS AND BOOMS, ORDNANCE', to_date('12/15/1978', 'MM/DD/YYYY'), NULL, 'Nets and Booms, Ordnance', NULL, 'This class includes nets and booms for harbor  defense only.', NULL),
('1075', 'DEGAUSSING AND MINE SWEEPING EQUIPMENT', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Degaussing and Mine Sweeping Equipment', NULL, NULL, NULL),
('1080', 'CAMOUFLAGE AND DECEPTION EQUIPMENT', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Camouflage and Deception Equipment', NULL, NULL, 'Dummy Artillery, Aircraft and Vehicles; Garnished Nets.'),
('1090', 'ASSEMBLIES INTERCHANGEABLE BETWEEN WEAPONS IN TWO OR MORE CLASSES', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Assemblies Interchangeable Between Weapons in Two or More  Classes', NULL, NULL, 'Components and Accessories used on or with weapons falling in two or more classes of group 10.'),
('1095', 'MISCELLANEOUS WEAPONS', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Miscellaneous Weapons', NULL, NULL, 'Line Throwing Guns; Catapult Guns; Bayonets; Saluting Guns; Signal Guns; Flare Guns; Barrage Balloons; Accessories, not elsewhere classifiable, for Weapons in this group; Expendable Bomb Dispensers.'),
('11', 'NUCLEAR ORDNANCE', to_date('10/01/1979', 'MM/DD/YYYY'), NULL, NULL, NULL, 'This group includes, in particular, nuclear  ordnance training weapons, practice ballistic units, and all components specially designed therefore, when not specifically classified elsewhere.  Also included in the group are specially designed simulators and mockups, which are  integral parts of the above.  Excluded from this group  are general purpose nose cones, case sections, flare  sections or center sections designed to carry payloads  other than nuclear and/or for use on a missile, rocket,  or re-entry vehicle to attain the necessary aerodynamic  configuration.', NULL),
('1105', 'NUCLEAR BOMBS', to_date('12/15/1978', 'MM/DD/YYYY'), NULL, 'Nuclear Bombs', 'Parachute canopies and canopy hardware.', 'This class includes nuclear weapons (including bombs), which are designed to be dropped from an aircraft.', 'Ballistic cases, tail assemblies, retardation devices, and other peculiar components which are not  classifiable elsewhere.'),
('1110', 'NUCLEAR PROJECTILES', to_date('01/15/1980', 'MM/DD/YYYY'), NULL, 'Nuclear Projectiles', NULL, 'This class includes nuclear weapons which are designed to be propelled from a recoilless rifle, gun,  howitzer, or the like, and which are not designed to be  self propelled.', 'Ogive sections, body sections, bases, and other peculiar components which are not classifiable elsewhere.'),
('1115', 'NUCLEAR WARHEADS & WARHEAD SECTIONS', to_date('11/15/1978', 'MM/DD/YYYY'), '09/30/2011', 'Nuclear Warheads and Warhead  Sections', 'Such components as fuzing and firing devices,  nuclear components, high explosive components, classifiable in more specific classes, and items such as projectiles  and bombs which include the entire outer case of a weapon.', 'This class includes nuclear warheads (without or assembled with case sections, adaption kits, and/or fuzing and firing components) which are to be used in or with bombs, rockets, projectiles, missiles, demolition charges, or the like.  Also includes case sections, nose cones,  flare sections, center sections, and auxiliary structural components of missiles, rockets, and re-entry vehicles  which are designed or constructed for exclusive use with or for housing of nuclear warheads and/or warhead sections.', 'Components and parts peculiar to the warhead or warhead section, which are not classifiable in more specific classes.'),
('1120', 'NUCLEAR DEPTH CHARGES', to_date('01/15/1985', 'MM/DD/YYYY'), NULL, 'Nuclear Depth Charges', NULL, 'This class includes nuclear weapons which consist  of depth charge bodies assembled with nuclear warheads.  It includes training weapons and all specially designed  components which are not classifiable elsewhere.', NULL),
('1125', 'NUCLEAR DEMOLITION CHARGES', to_date('10/01/1991', 'MM/DD/YYYY'), NULL, 'Nuclear Demolition Charges', NULL, 'This class includes nuclear weapons which are designed to be emplaced in or near a structure, area or  the like, which is to be destroyed.  The weapons may include accessories.', 'Outer cases, case sections and other peculiar  components, which are not classifiable elsewhere.'),
('1127', 'NUCLEAR ROCKETS', to_date('09/15/1982', 'MM/DD/YYYY'), NULL, 'Nuclear Rockets', 'Rocket Motors; Warhead Components; Rocket  Components classified in other FSC classes.', 'This class includes nuclear weapons, consisting of rocket bodies assembled with nuclear warheads,  which comprise a single item of supply and are issued as such.', 'Components peculiar to assembled rockets which are not classifiable elsewhere.'),
('1130', 'CONVERSION KITS, NUCLEAR ORDNANCE', to_date('06/15/1979', 'MM/DD/YYYY'), NULL, 'Conversion Kits, Nuclear Ordnance', NULL, 'This class Includes collections of items used for the purpose of  converting nuclear weapons from one configuration to another.', NULL),
('1135', 'FUZING AND FIRING DEVICES, NUCLEAR ORDNANCE', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Fuzing and Firing Devices, Nuclear Ordnance', NULL, NULL, 'Such items as fuzes, power supplies, firing sets, X-units, cables, safing devices, adaption kits, and  re-entry vehicle nuclear ordnance arming and fuzing systems.'),
('1140', 'NUCLEAR COMPONENTS', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Nuclear Components', 'End items, such as bombs, projectiles, warheads, and the like.', NULL, 'All components which contain or simulate nuclear active materials.'),
('1145', 'EXPLOSIVE & PYROTECHNIC COMPS, NUCL', to_date('09/15/1979', 'MM/DD/YYYY'), '09/30/2011', 'Explosive and Pyrotechnic Components, Nuclear Ordnance', NULL, 'This class includes actual and simulated explosive and pyrotechnic components peculiar to all nuclear ordnance end items such as bombs, demolition charges, rockets, projectiles, warheads, and related systems.  Excluded from this class are all explosive and pyrotechnic components designed for other than nuclear ordnance applications.', NULL),
('1190', 'SPEC TEST & HANDLING EQ, NUCLEAR EQ', to_date('11/15/1978', 'MM/DD/YYYY'), '09/30/2011', 'Specialized Test and Handling Equipment, Nuclear Ordnance', 'Hand tools; Instruments for use on both nuclear ordnance and other equipment; Basic types of electrical and electronic test instruments, including those specially designed, such as ammeters, voltmeters, ohmmeters, multimeters, and similar instruments, as shown in the indexes in the FSC.', NULL, 'Specially designed trucks and trailers for nuclear ordnance; Specially designed slings and hoists; Operational, test, and setting devices, and cradles; Conditioning Kits and Sets, Controlled Environment.'),
('1195', 'MISCELLANEOUS NUCLEAR ORDNANCE', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Miscellaneous Nuclear Ordnance', NULL, NULL, 'Items common to more than one class or items not properly fitting into the foregoing classes of nuclear ordnance'),
('12', 'FIRE CONTROL EQPT.', to_date('10/01/1979', 'MM/DD/YYYY'), NULL, NULL, NULL, 'Fire Control assemblies, subassemblies, and components are classified: a.  In appropriate classes of this group when:  (1)  Designed for multiple applications to different kinds of fire control equipment. (2)  Modified for use with guided missile remote control systems. (3)  Designed specifically for shipborne guided missile  remote control systems. (4)  Radar equipment, designed specifically for fire control systems. (5)  Both day and night viewing characteristics are incorporated into an integral unit.  b.  In class 1270 or 1280, when designed specifically for  aircraft gunnery or aircraft bombing fire control,  respectively.  c.  In class 1430, when designed specifically for guided missile remote control systems, except shipboard type. d.  In appropriate classes of group 58, when designed for  multiple applications to both fire control and  communication equipment. e.  In appropriate classes of group 58 when designed for night vision.', NULL),
('1210', 'FIRE CONTROL DIRECTORS', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Fire Control Directors', NULL, NULL, NULL),
('1220', 'FIRE CONTROL COMPUTING SIGHTS AND DEVICES', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Fire Control Computing Sights and Devices', NULL, NULL, NULL),
('1230', 'FIRE CONTROL SYSTEMS, COMPLETE', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Fire Control Systems, Complete', NULL, 'This class includes only complete fire control systems. Anything less than a complete system, such as individual end items, assemblies, parts, attachments, or accessories for use in fire control systems are classified in classes other than this class.', NULL),
('1240', 'OPTICAL SIGHTING AND RANGING EQUIPMENT', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Optical Sighting and Ranging Equipment', NULL, NULL, 'Periscopes for Submarines; Range and Height  Finders; Telescopic Sights;  Optical Instruments Integrated with Fire Control Equipment.'),
('1250', 'FIRE CONTROL STABILIZING MECHANISMS', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Fire Control Stabilizing Mechanisms', NULL, NULL, NULL),
('1260', 'FIRE CONT DESIGNATING-INDICATING EQ', to_date('10/15/1978', 'MM/DD/YYYY'), '09/30/2011', 'Fire Control Designating and Indicating Equipment', NULL, NULL, 'Turret, Gun, Torpedo Mount, and Searchlight Indicating Equipment; Target Designating Equipment; Synchro Systems.'),
('1265', 'FIRE CONT EQ EXCEPT AIRBORNE', to_date('10/15/1978', 'MM/DD/YYYY'), '09/30/2011', 'Fire Control Transmitting and Receiving Equipment, except Airborne', 'Fire Control Transmitting and Receiving Equipment, Specially Designed for use on or with Fire Control Radar Equipment.', NULL, 'Fire Control Transmitters, Transmitter-Receivers, Receivers, Receiver-Regulators.'),
('1270', 'AIRCRAFT GUNNERY FIRE CONT COMPS', to_date('10/15/1978', 'MM/DD/YYYY'), '09/30/2011', 'Aircraft Gunnery Fire Control Components', 'Gun Chargers; Ammunition Boxes; Gun Heaters; Field and Link Chutes; Ammunition Boosters; Gyro Components; Complete Fire Control Systems.', NULL, 'Turrets, Aircraft; Computers, specifically designed; Complete Gyro Mechanisms.'),
('1280', 'AIRCRAFT BOMBING FIRE CONT COMPS', to_date('10/15/1978', 'MM/DD/YYYY'), '09/30/2011', 'Aircraft Bombing Fire Control Components', 'Gyro Components; Optical Elements, such as Lens, Prisms, Filters.', NULL, 'Computers, specifically designed; Complete Gyro Mechanisms; Optical Instruments for Bombing Fire Control.'),
('1285', 'FIRE CONTROL RADAR EQUIPMENT, EXCEPT AIRBORNE', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Fire Control Radar Equipment, except Airborne', NULL, NULL, 'Radar Sets, Assemblies, Subassemblies, and Components Specially Designed for use on or with Fire Control Equipment.'),
('1287', 'FIRE CONTROL SONAR EQUIPMENT', to_date('01/15/1979', 'MM/DD/YYYY'), NULL, 'Fire Control Sonar Equipment', NULL, 'This class includes airborne, shipborne, and submarineborne sonar sets, assemblies, subassemblies, and components designed specifically for use with underwater fire control equipment.', NULL),
('1290', 'MISCELLANEOUS FIRE CONTROL EQUIPMENT', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Miscellaneous Fire Control Equipment', NULL, NULL, 'Fuze Setters; Ordnance Cable Systems;  Aiming Circles; Flash and Sound Ranging Sets; Fire  Control Components and Subassemblies Not Classifiable in other classes of group 12.'),
('13', 'AMMUNITION AND EXPLOSIVES', to_date('10/01/1979', 'MM/DD/YYYY'), NULL, NULL, NULL, 'Excluded from this group are items specially designed for nuclear ordnance application.', NULL),
('1305', 'AMMUNITION, THROUGH 30 MM', to_date('10/15/1978', 'MM/DD/YYYY'), '09/30/2011', 'Ammunition, through 30 mm', NULL, NULL, 'Components.'),
('1310', 'AMMUNITION, OVER 30MM UP TO 75MM', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Ammunition, over 30 mm up to 75 mm', 'Fuzes and Primers.', NULL, 'Components, except Fuzes and Primers; Chemical Warfare Cartridges.'),
('1315', 'AMMUNITION, 75 MM THROUGH 125 MM.', to_date('10/15/1978', 'MM/DD/YYYY'), '09/30/2011', 'Ammunition, 75 mm through 125 mm.', 'Fuzes and Primers.', NULL, 'Components except Fuzes and Primers; Pyrotechnic Cartridges and Projectiles; Chemical Warfare Cartridges and Projectiles'),
('1320', 'AMMUNITION, OVER 125 MM', to_date('10/15/1978', 'MM/DD/YYYY'), '09/30/2011', 'Ammunition, over 125 mm', 'Fuzes and Primers.', NULL, 'Components, except Fuzes and Primers; Chemical  Warfare Projectiles.'),
