('1367', 'TACTICAL SETS, KITS, AND OUTFITS', to_date('05/01/2005', 'MM/DD/YYYY'), NULL, 'A collection of items, which are used for a specific purpose.', NULL, 'These sets,kits and outfits may include such items as uniforms, weapons, body armor, and the like. By themselves, each of these components belongs in an FSC other than 1367.', 'Each collection must include at least one item of ordnance classified in Group 13. Ordnance may be non-lethal (as defined in the Department of Defense Directive 3000.3)'),
('1370', 'PYROTECHNICS', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Pyrotechnics', 'Pyrotechnic Cartridges and Projectiles; Photoflash Bombs; Pyrotechnic Rockets.', NULL, 'Flares; Signals; Fireworks; Pistol Rocket Signals.'),
('1375', 'DEMOLITION MATERIALS', to_date('11/15/1978', 'MM/DD/YYYY'), NULL, 'Demolition Materials', 'Liquid Propellant Fuels and Oxidizers; Solid Propellants encased in consumable containers, for insertion into missile propulsion systems as integral parts; Guided Missile Explosive Devices; Safety-in-Flight Explosive Items and Devices such as, Impulse Cartridges, Delay Cartridges, Aircraft Ejection Seat Catapults, Aircraft Canopy Removers, and similar items, as shown in the indexes to the FSC; Solid Propellants, predetermined to specific quantity and quality, packaged in reusable containers; Nuclear Ordnance Components; Rocket and Guided Missile Motors, Warheads, and Propulsion Sections.', NULL, 'Items for construction, quarrying and demolition work such as Dynamite and other explosives packed in cylindrical paper cartridges or in bags, Demolition Charges; Blasting Caps; Blasting Time Fuses; Detonating Cord; Demolition Firing Devices; Booby Trap Mechanisms; Bangalore Torpedoes; Inert accessories and components such as Blasting Machines, Priming Adapters, and Detonating Cord Clips.'),
('1376', 'BULK EXPLOSIVES', to_date('12/15/1978', 'MM/DD/YYYY'), NULL, 'Bulk Explosives', 'Liquid Propellant Fuels and Oxidizers; Solid Propellants encased in consumable containers, for insertion into missile propulsion systems as integral parts; Guided Missile Explosive Devices; Blasting and Demolition Materials; Safety-in-Flight Explosive Items and Devices such as Impulse Cartridges, Delay Cartridges, Aircraft Ejection Seat Catapults, Aircraft Canopy Removers; Rocket and Guided Missile Motors, Warheads, and Propulsion Sections; similar items, as shown in the indexes to the FSC.', NULL, 'Solid Propellants, predetermined to specific quantity and quality, packaged in reusable containers; Explosive Loaded Devices and Components as shown in the indexes to the FSC.'),
('1377', 'CARTRIDGE & PROPELLANT DEVICES', to_date('10/15/1978', 'MM/DD/YYYY'), '09/30/2011', 'Cartridge and Propellant Actuated Devices and Components', 'Liquid Propellant Fuels and Oxidizers; Solid Propellants, encased in consumable containers for insertion into missile propulsion systems as an integral part; Guided Missile Explosive Devices; Bulk and Solid Propellants, predetermined to specific quantity and quality, packaged in reusable containers; Blasting and Demolition Materials; Rocket Motors, Warheads and Propulsion Sections for Rockets and Guided Missiles.', 'This class includes safety-in-flight explosive items, consisting of a quantity of propellant (either encased in a cartridge or in molded form) and a means of activation, designed to be inserted into or attached to one or more devices to provide the energy required to operate devices requiring a time delay, or not requiring a time delay, in their operating sequence.  Also included are devices designed to utilize energy generated by the items described above.', 'Impulse Cartridges; Delay Cartridges; Enginents e Starter Cartridges (explosive filled), Fire Extinguisher Cartridges (used to activate by remote control), Aircraft Ejection Seat Catapults; Rocket Motors (Solid Propellant Units) for Aircraft Ejection Seats; Aircraft Canopy Removers; Thrusters, propellant and cartridge actuated; Initiators; Explosive Bolts and Explosive Bolt Cartridges; Cutters, cartridge or propellant actuated, Reefing Line; Powder actuated Tool Cartridges; Explosive Loaded Devices and Components which are not specifically classified elsewhere.'),
