('1510', 'AIRCRAFT, FIXED WING', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Aircraft, Fixed Wing', NULL, 'This class includes only complete aircraft.  End  items, assemblies, parts, attachments, or accessories for  use in or on fixed wing aircraft are classified in classes  other than this class.', NULL),
('1520', 'AIRCRAFT, ROTARY WING', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Aircraft, Rotary Wing', NULL, 'This class includes only complete aircraft.  End items, assemblies, parts, attachments, or accessories for use in or on rotary wing aircraft are classified in classes other than this class.', 'Helicopters.'),
('1540', 'GLIDERS', to_date('05/15/1979', 'MM/DD/YYYY'), NULL, 'Gliders', NULL, 'This class includes only complete gliders.  End items, assemblies, parts, attachments, or accessories for use in or on gliders are classified in classes other than this class.', 'Motorized Gliders.'),
('1550', 'DRONES', to_date('10/15/1978', 'MM/DD/YYYY'), '09/30/2011', 'Drones', 'Piloted aircraft and guided missiles converted to drone use.', 'This class includes only complete drones. End items, assemblies, parts, attachments, or accessories for use in or on drones are classified in classes other than this class.', 'Drones specifically designed for such uses as targets, training, surveillance, missile evaluation, and photographic  reconnaissance.'),
('1555', 'SPACE VEHICLES', to_date('10/01/2015', 'MM/DD/YYYY'), NULL, NULL, NULL, 'This class  includes only complete space vehicles in assmebled or unassembled form.', NULL),
('1560', 'AIRFRAME STRUCTURAL COMPONENTS', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Airframe Structural Components', 'Fitted Covers; Helicopter Rotor Brake System and Components; Aircraft Loose Equipment and Alternate Mission Configuration Equipment stored on board the Aircraft.', 'This class includes fabricated system parts that are permanently attached or peculiar to the integral airframe of an aircraft, such as support structural components, spars, ribs, ailerons, stablizers, bulkheads.', 'Flight Control Surfaces, internal and external Auxiliary Fuel Tanks; Exhaust Systems, Pylons, Trim Tabs; Aircraft.'),
