('1640', 'AIRCRAFT CONTROL CABLE PRODUCTS', to_date('05/01/2005', 'MM/DD/YYYY'), NULL, 'Missing code added for DOD Migration purpose only', 'General use Chain and Wire Rope (FSC 4010), general use Pulleys(FSC 3020),general use Miscellaneous Hardware (FSC 5340), general use Fittings for Rope, Cable and Chain (FSC 4030).', 'Wire rope, with attachments or terminations and pulleys,used in aircraft control applications,will be classified in this class', 'Wire Rope; Single Leg Wire Assemblies; Wire Strands;Control Pulleys;Turnbuckle Lock Clips and other wire rope attachments and terminations.'),
('1650', 'AIRCRAFT HYDRAULIC, VACUUM, AND DE-ICING SYSTEM COMPONENTS', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Aircraft Hydraulic, Vacuum and De-icing System Components', 'Jet Engine Hydraulic Components (FSC 2840), Valves specifically designed for air conditioning, heating. ventilating, cabin pressurizing, and thermal de-icing (FSC 1660), Valves specifically designed for use with Aircraft Engines (FSC 2840), Guided Missiles and Guided Missile Engines (FSC 1338), Landing Gear (FSC 1620), Wheel and Brake System Components (FSC 1630), Oxygen Breathing System Components (FSC 1660), In-flight Refueling System Hydraulic components (FSC 1680), Specifically designed hydraulic power steering system components (FSC 1620).', 'This class includes only those components specifically designed for aircraft use.', 'Hydraulic and Pneumatic Accumulators, Pumps, Motors, Actuating Cylinders, and Filters; De-icing Boots; Fluid Type De-icing Pumps, Valves and Filters; Vacuum System Oil Separators; Pneumatic Pressurization Equipment other than that for pressurizing cabins and compartments.'),
('1660', 'AIRCRAFT AIR CONDITIONING, HEATING, AND PRESSURIZING EQUIPMENT', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Aircraft Air Conditioning, Heating, and Pressurizing Equipment', 'Oxygen Pressure Signals and Warning Devices; Tubing; Ground Type Heaters and Coolers; Pressurizing Equipment other than that used for Cabin and Compartment Pressurization; Fluid De-icing Equipment; Valves specifically designed for use with Aircraft Engines, Guided Missiles, and Guided Missile Engines.', 'This class includes components specifically designed for use in aircraft air conditioning, heating, and pressurizing equipment.  Also included are specially designed components of oxygen breathing systems used in aircraft.', 'Cabin Supercharging Equipment; Canisters; Cylinder Assemblies; Masks; Fixed Oxygen Systems; Specially Designed Aircraft Valves; Cabin Pressure Regulators; Heat Exchangers; Air Expansion Turbines; Aircraft Heaters; Ventilating System Components; Air Conditioning and Heating Duct Assemblies; Thermal De-icing Equipment; Cabin and Compartment Pressurizing Equipment; Air Diffusers; Cabin Pressure Selectors; Liquid Oxygen Converters.'),
('1670', 'PARACHUTES; AERIAL PICK UP, DELIVERY, RECOVERY SYSTEMS; AND CARGO TIE DOWN EQUIPMENT', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Parachutes; Aerial Pick Up, Delivery, Recovery Systems; Cargo Tie Down Equipment', 'Fitting Assemblies built into the aircraft structure.', 'Includes specifically designed items, sets, and systems for air-to-air, air-to-surface, and surface-to-air delivery, pick up and recovery operations, unless parts, attachments, assemblies, for use in or on such systems (i.e. space vehicle aerial recovery systems) are specifically indexed to other classes of the FSC (i.e., transmitting radio buoys and direction finding subsystem components).', 'Fitting Assemblies built into the aircraft structure.'),
('1675', 'SPACE VEHICLE COMPONENTS', to_date('10/01/2015', 'MM/DD/YYYY'), NULL, 'Space Vehicle Components', 'Remote Guidance Equipment.', NULL, 'Structural components; Components and Accessories Specially Designed for installation in or on Space Vehicles; Internal (Built-In) Control Systems. '),
