('3655', 'GAS GENERATING AND DISPENSING SYSTEMS, FIXED OR MOBILE', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Gas Generating and Dispensing Systems, Fixed or Mobile', 'Meteorological Equipment.', 'Included in this class are gaseous dispensing systems, both mobile and installed.', 'Liquefied gaseous storage tanks, mounted on a common base with, or integral to, gas generating equipment included  in this class.  Also includes those liquefied gaseous storage tanks, either trailer mounted or skid mounted, used to store  liquefied gaseous products until needed.  Excluded from this  class are those storage tanks designed to be used as an  integral part of guided missile propellant servicing trailers, rocket power plants or test stations, and aircraft oxygen converters which are classified as specified by the indexes  and structure of the FSC.'),
