('3670', 'SPECIALIZED SEMICONDUCTOR, MICROCIRCUIT, AND PRINTED CIRCUIT BOARD MANUFACTURING MACHINERY', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Specialized Semiconductor, Microcircuit, and Printed  Circuit Board Manufacturing Machinery', 'Assembly Machines for Mounting Discrete Components on Printed Wiring Boards.', 'This class includes, and is restricted to, equipment specifically designed for manufacturing semiconductor devices (FSC 5961), microcircuits (FSC 5962), and printed circuit boards (FSC 5998).  Excludes items for which more suitable classes are specifically prescribed by the indexes and  structure of the FSC.', 'Substrate Preparation Equipment; Circuit Pattern Forming Equipment; Interconnecting and Packaging Equipment.'),
