('4730', 'FITTINGS - HOSE PIPE & TUBE', to_date('10/15/1978', 'MM/DD/YYYY'), '09/30/2011', 'Hose, Pipe, Tube, Lubrication, and Railing Fittings', 'Air Conditioning-Heating Fittings (FSC 4520), Bituminized Fiber and Concrete Fittings (FSC 5630), Conduit Boxes and Fittings (FSC 5975), Downspout Fittings (FSC 5670), Medical and Surgical Fittings (FSC 6515), Laboratory Fittings (FSC 6640), Post Caps and Rail Ends (FSC 5660), Machine Thread Bushings and Plugs (FSC 5365).', NULL, 'Adapters; Bends; Caps; Clamps; Connectors; Couplings; Crosses; Elbows; Expansion Joints; Ferrules; Flanges; Laterals; Lubrication Fittings; Manifolds; Nipples; Nozzles; Outlets; Plugs; Reducers; Swing and Swivel Joints; Tees; Traps; Unions; Wyes.'),
('48', 'VALVES', to_date('10/01/1979', 'MM/DD/YYYY'), NULL, NULL, NULL, 'This group excludes valves designed for use on  individual types of equipment or systems.  Excluded are such items  as tire valves, engine intake and exhaust valves, carburetor valves, water mixing valves, and flush valves.', NULL),
