('5210', 'MEASURING TOOLS, CRAFTSMEN''S', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Measuring Tools, Craftsmen''s', NULL, 'This class does not include special inspection gages, which are classified  in class 5220.', 'Calipers; Levels; Micrometers; Plumb Bobs; Precision Tapes; Squares; Angle Gages; Center Gages; Depth Gages; Draw Gages; Drill Point Gages; Fillet and  Radius Gages; Glaziers'' Gages; Height Gages (Vernier), Planer Gages; Rivet Selector Gages; Saw Tooth Set Gages; Screw Pitch Gages; Surface Gages; Telescoping Gages; Thickness Gages; Tube Bead Gages; Tube Flare Gages;  Twist Drill Gages; Twist Drill and Rod Gages; Twist Drill and Tap Gages; Taper-Wire-Thickness Gages; Wire Gages; Tool Setting Planer and Shaper Gages; Gage Blocks.'),
