('5310', 'NUTS AND WASHERS', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Nuts and Washers', 'Bearing Thrust Washers (FSC 3120), Shims (FSC 5365), Ring Spacers (FSC 5365), Plate Spacers (FSC 5365), Lock Rings (FSC 5365).', 'Nuts and washers, including specially designed, are to be classified in this FSC.  a.  Nuts are a small metal block made in a variety of shapes such as square and hexagonal which is drilled and internally threaded.  b.  Washers are a perforated piece of metal, leather, or other materials of various shapes or forms.  They are used primarily as a seat for a bolt, nut, screw, rivet or nail to distribute pressure and prevent endwise motion over an area and/or to prevent movement between two parts by means of restraining features created by the shape of its edges.', 'Locknuts; Eye Nuts; Plain Nuts; Castellated Nuts; Wing Nuts; Plate Nuts; Push on Nuts; Concave and Convex Washers; Flat Washers; Keyed Washers; Lock Washers; Shouldered Washers; Split Washers.'),
('5315', 'NAILS, MACHINE KEYS, AND PINS', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Nails, Machine Keys, and Pins', 'Shafts (FSC 3040), Lock Keys (FSC 5340).', 'Nails, machine keys, and pins, including specially designed, will be classified in this FSC.  a.  Nails are slender, usually pointed fasteners with a head, and designed for insertion by impact.  b.  Machine keys are items generally inserted between two items, usually in a groove, to prevent relative rotation, e.g., shaft and hub,  c.  Pins are cylindrical items of various materials used to align/attach two or more parts together and may allow for angular movement.', 'Dowel Pins, Split Pins; Spikes; Tacks; Nonoffice Type Staples; Machine  Keys; Brads; Shouldered Pins; Cotter  Pins; Nails.'),
('5320', 'RIVETS', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Rivets', NULL, NULL, NULL),
('5325', 'FASTENING DEVICES', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Fastening Devices', NULL, NULL, 'Eyelets; Grommets; Aircraft Cowling Fasteners; Textile Fasteners; Retaining Rings; Threaded Inserts.'),
('5330', 'PACKING AND GASKET MATERIALS', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Packing and Gasket Materials', 'O-Rings (FSC 5331), Bulk material items, such as; Rubber, Cork, and Asbestos Sheets and Strips (FSG 93), Liquid Gasket Materials (RTV), Permatex, etc.) (FSG 80), RFI and EMI Seals and Gaskets (FSC 5999), and all Seal Retainers.', 'This FSC includes only seals and gaskets designed for standard use.  Seals, gaskets and packing are made from materials specifically designed and constructed to resist deterioration from the action of heat, gas, chemicals, liquids, and used to fill a cavity and create a tight seal.  Similar materials used to make seals, gaskets and packing are available in bulk form, refer to FSG 93, FSG 80, and FSG 83.', 'General Purpose Oil Grease, Air, Liquid, Gas, and chemical Seals; Oakum; Prefabricated Gaskets and Seals designed for a single specific application.'),
('5331', 'O-RING', to_date('10/01/1998', 'MM/DD/YYYY'), NULL, 'O-Ring', 'Packing and Gasket Material (FSC 5330).', NULL, NULL),
('5335', 'METAL SCREENING', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Metal Screening', 'Fencing (FSC 5660).', 'Metal Screening is a perforated plate or cylinder or a meshed wire fabric usually mounted and used to separate coarse from finer parts.', 'Insect Screening; Industrial Metal Cloth; Industrial Metal Mesh.'),
('5340', 'HARDWARE, COMMERCIAL', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Hardware', 'Weapons System Hardware (5342).', 'Common hardware designed primarily for commercial use will be classified in this FSC.  Hardware is the physical, tangible, and permanent components of end items that may not be classified elsewhere.  It consists also of common items that are commonly used in construction and/or manufacturing (e.g., hinges, door locks).', 'Access Covers; Bumpers; Casters; Cabinet and Door Hardware; Clevises; Hinges; Latches; Straps and Strapping; Turnbuckles; Webbed Straps.'),
('5341', 'BRACKETS', to_date('10/01/1998', 'MM/DD/YYYY'), '09/30/2011', 'Brackets', 'Corner Braces (FSC 5340), "T" Braces (FSC 5340), Mending Plates (FSC 5340).', 'All brackets, including specially designed for specific use and/or application, will be classified in this FSC.  Brackets are items of rigid construction that sustain a secondary item.', 'Angle Brackets; Double Angle Brackets; Mounting Brackets.'),
('5342', 'HARDWARE, WEAPON SYSTEM', to_date('10/01/1998', 'MM/DD/YYYY'), NULL, 'Hardware, Weapon System', 'Commercial Hardware (FSC 5340).', 'Hardware designed for weapon systems unique applications will be classified in this FSC.', 'Adapters; Anchor Plates and Straps; Anodes; Bellows; Couplings; Control Rods; Access Doors; Fairleads; Mounts; Tie Rods; Yokes.'),
('5345', 'DISKS AND STONES, ABRASIVE', to_date('11/15/1978', 'MM/DD/YYYY'), NULL, 'Disks and Stones, Abrasive', 'Dental Abrasives; Abrasive Cones, and other Abrasive Attachments for equipment.', NULL, 'Abrasive Belts and Belting; Hones; Abrasive Wheels, Multiapplication.'),
('5350', 'ABRASIVE MATERIALS', to_date('10/15/1978', 'MM/DD/YYYY'), NULL, 'Abrasive Materials', NULL, NULL, 'Cloth; Papers; Powders; Abrasive Polishing Compounds; Metal  Finishing Abrasives; Industrial Diamonds; Diamond Dust; Rouge.'),
