('5995', 'CABLE CORD WIRE ASSEMBLY - COMM EQ', to_date('10/15/1978', 'MM/DD/YYYY'), '09/30/2011', 'Cable, Cord, and Wire Assemblies: Communication Equipment', 'Cable Assemblies, Fiber Optic', 'This class includes only those types of cable, cord, and wire  assemblies and sets (and wiring harnesses) used on or  with equipment  and components covered by groups 58 and 59. Cable, cord, wire assemblies,  and sets (wiring harnesses) used on or with equipment classified in FSC groups  other than groups 58 or 59 are classified in FSC class 6150 if multiapplication, or classified with the next higher classifiable assembly if specially designed.', 'Cable Assemblies, Fiber Optic'),
('5996', 'AMPLIFIERS', to_date('10/01/1991', 'MM/DD/YYYY'), NULL, 'Amplifiers', 'Multi-functional items such as Amplifier-Detector, Amplifier-Mixer and microcircuit devices.', NULL, 'Audio Amplifiers, Complementary Amplifiers, Amplifiers, Operational Amplifiers, Power Amplifiers, Radio Frequency Amplifiers, Signal Amplifiers, and Video Amplifiers.'),
