('6116', 'FUEL CELL POWER UNITS, COMPONENTS, AND ACCESSORIES', to_date('10/01/2011', 'MM/DD/YYYY'), NULL, 'Fuel Cell Power Units, Components, and Accessories', 'Primary Batteries (FSC 6135), Secondary Batteries (FSC 6140), Generators and Generating Sets (FSC 6115), and items for which more suitable classes are specifically prescribed by the indexes and structure of the FSC.', 'This class includes items that are designed to produce an electromotive  force directly from an oxidation-reduction type of chemical reaction.  A complete  power unit must include tanks, pumps, and associated control equipment, and  requires a continuous, uninterrupted supply of liquid or gaseous fuel and oxidizers.', 'Complete Functioning Fuel Cell Power Units; Fuel Cells: Fuel Cell Assemblies or Modules; Fuel Cell Reactant Chambers; Fuel Feed Mechanism; Electrolyte Heaters; Heat Exchangers; and other internal components peculiar to, and used exclusively  on or with, Fuel Cell Power Units classified in this class.'),
