('6625', 'ELECT ELECTRONIC MEASURING INSTRUMT', to_date('10/15/1978', 'MM/DD/YYYY'), '09/30/2011', 'Electrical and Electronic Properties Measuring and Testing Instruments', 'Radiac Equipment.', 'This class includes all "basic" types of electrical and electronic test instruments, such as ammeters, voltmeters, ohmmeters, multimeters, and similar instruments, even if specially designed.  Excluded from this class by the modifier "except specially designed" are test instruments, other than "basic" instruments, which are specially designed for use with atomic ordnance, fire control, guided missile, motor vehicle, aircraft, or photographic equipment.  Such specially designed test instruments are to be classified in other classes in the Federal Supply Classification. This class includes communications test equipment, infrared test equipment designed for communication, and night vision maintenance and test specialized equipment.', 'Test Leads and Test Lead Attachments; Test instruments designed for communication equipment; Test instruments designed for use with electronic equipment classified in two or more FSC groups.'),
