('8145', 'SPECIAL SHIPPING & STORAGE CONTAIN', to_date('10/15/1978', 'MM/DD/YYYY'), '09/30/2011', 'Specialized Shipping and Storage Containers', 'General purpose containers; specially designed containers  for ammunition, nuclear ordnance, explosives, military chemical agents  and guided missile components.  Excluded from this class are items for  which more specific classifications are suitable.  The FSC indexes and structure will govern the classification of those items permitted  classification in a single class only.', 'This class includes only reusable and repairable containers  specially designed for shipping and storage of specialized equipment;  i.e., shipping and storage containers for components of aircraft, space  vehicles, automotive vehicles, ships, ground communication equipment,  etc.', 'Specially designed components (not elsewhere classifiable)  peculiar to special shipping and storage containers as delimited under this class.'),
