INSERT INTO oc_perennial.place_of_manufacture
(code, name, description) VALUES
('A', 'Performed or Manufactured in US, but services performed by a foreign concern or more than 50% foreign content', 'The action is for (i) A foreign end product that is manufactured in the United States but still determined to be foreign because 50 percent or more of the cost of its components is not mined, produced, or manufactured inside the United States or inside qualifying countries; or (ii) Services performed in the United States by a foreign concern. Note: This value is not valid after Sept 30, 2006.'),
('B', 'Performed or Manufactured outside US', 'The action is for (i) Any other foreign end product; or (ii) Services performed outside the United States by a foreign concern. Note: This value is not valid after Sept 30, 2006.'),
('C', 'Not a manufactured end product', 'Not a manufactured end product action'),
('D', 'Mfg in U.S.', 'The action is predominantly for acquisition of manufactured end products that are manufactured in the United States'),
('E', 'Mfg outside U.S. - Use outside the United States', 'The foreign manufactured end products acquired are predominantly for use outside the United States (FAR 25.100).'),
('F', 'Mfg outside U.S. - Resale', 'The foreign manufactured end products acquired are predominantly for resale (FAR 25.103(d).'),
('G', 'Mfg outside U.S. - Trade Agreements', 'The foreign manufactured end products are predominantly eligible products acquired under Trade Agreements (FAR 25.402(a)(1)).'),
('H', 'Mfg outside U.S. - Commercial information technology', 'The foreign manufactured end products are predominantly commercial information technology items (FAR 25.103(e)).'),
('I', 'Mfg outside U.S -Public interest determination', 'The head of the agency has made a determination that domestic preferences would be inconsistent with the public interest (FAR 25.103(a)).'),
('J', 'Mfg outside U.S. - Domestic non-availability', 'The foreign manufactured end products were predominantly not domestically available as shown by one of the following: (i) The item is listed at FAR 25.104 (FAR 25.103(b)(1). (ii) The agency did an individual determination (FAR 25.103(b)(2)). (iii) No offer of a domestic end product was received, even though the acquisition was synopsized and conducted through full and open competition (FAR 25.103(b)(3).'),
('K', 'Mfg outside U.S. - Unreasonable cost', 'The cost of the offered domestic end products was unreasonable (FAR 25.103(c), 25.105, and Subpart 25.5)'),
('L', 'Mfg outside U.S. - Qualifying country (DOD only)', 'For DoD only, the foreign manufactured end products are predominantly qualifying country end products (DFARS 225.003
