('NDO', 'Non-Competitive Delivery Order', 'Competitive procedures are not used in awarding the delivery order for a reason not included in the other options (when the action was non-competitive). (Note: This is not applicable to Version 1.4 documents.)')
INSERT INTO oc_perennial.reason_not_competed
(code, name, description) VALUES
