('URG', 'Urgency (FAR 6.302-2)', 'Action was justified pursuant to FAR 6.302-2.'),
('MES', 'Mobilization, Essential R&D (FAR 6.302-3)', 'Action was justified pursuant to FAR 6.302-3(a)(2).'),
