('NS', 'National Security (FAR 6.302-6)', 'Action was justified pursuant to FAR 6.302-6.'),
('PI', 'Public Interest (FAR 6.302-7)', 'Action was justified pursuant to FAR 6.302-7.'),
('MPT', 'Less than or equal to the Micro-Purchase Threshold', 'Action was justified pursuant to FAR 13.202'),
