INSERT INTO oc_perennial.commercial_item_acquisition_procedures
(code, name, description) VALUES
('A','Commercial Item', 'Select this value when the action is for a commercial item using FAR Part 12 commercial item procedures.'),
('B', 'Supplies or services pursuant to FAR 12.102(f)', 'Select this value for any acquisition of supplies or services, determined by the head of the agency, to be used to facilitate defense against or recovery from nuclear, biological, chemical, or radiological attack pursuant to FAR 12.102(f) that uses commercial item procedures.'),
('C', 'Services pursuant to FAR 12.102(g)', 'Select this value for any acquisition of services that does not meet the definition of commercial item but meets the criteria in FAR 12.102(g). Specifically, (i) Is entered into on or before November 24, 2013; (ii) Has a value of $27 million or less; (iii) Meets the definition of performance-based acquisition at FAR 2.101; (iv) Uses a quality assurance surveillance plan; (v) Includes performance incentives where appropriate; (vi) Specifies a firm-fixed price for specific tasks to be performed or outcomes to be achieved; and (vii) Is awarded to an entity that provides similar services to the general public under terms and conditions similar to those in the contract or taskorder. This code was ended effective November 25, 2013.'),
('D', 'Commercial Item Procedures not used', 'Select this value when commercial item procedures were not used.')
