INSERT INTO oc_perennial.solicitation_procedures
(code, name, description) VALUES
  ('NP', 'Negotiated Proposal/Quote', 'Report this code for contract awards over the Simplified Acquisition Threshold using negotiated procedures. FAR 12, FAR 13, and FAR15.'),
  ('SB', 'Sealed Bid', 'Report this code for contract award over the Simplified Acquisition Threshold using seal bidding procedures. FAR 14.'),
  ('TS', 'Two Step', 'Report this code for contract award over the Simplified Acquisition Threshold that uses a combination of sealed bids and negotiated procedures. FAR 6.102.'),
  ('SP1', 'Simplified Acquisition', 'Report this code for a competitive or non-competitive acquisition when Simplified Acquisition Procedures in FAR 13 are used.'),
  ('AE', 'Architect-Engineer FAR 6.102', 'Report this code if the action resulted from selection of sources for architect-engineer contracts pursuant to FAR 6.102(d)(1).'),
  ('BR', 'Basic Research', 'Report this code if the action resulted from competitive selection of basic research proposals pursuant to FAR 6.102(d)(2).'),
  ('AS', 'Alternative Sources', 'Report this code if the action resulted from the use of procedures that provide for full and open competition after exclusion of sources to reduce overall costs pursuant to FAR 6.202(a)(1), to have a facility available for national defense or industrial mobilization pursuant to FAR 6.202(a)(2), to establish or maintain an essential engineering, research, or development capability pursuant to FAR 6.202(a)(3), to ensure the continuous availability of a reliable source of supply for such property or service pursuant to FAR 6.202(a)(4), to satisfy projected needs for such product or service based on a history of high demand pursuant to FAR 6.202(a)(5), to satisfy a critical need for medical, safety, or emergency supplies pursuant to FAR 6.202(a)(6).'),
  ('SSS', 'Only One Source', 'Report this code if no solicitation procedure was used in this action.'),
  ('MAFO', 'Subject to Multiple Award Fair opportunity (pre CLOD: Multiple Award Fair opportunity)', 'Report this code if order was Subject to Multiple Award Fair Opportunity.'),
  ('X', 'Invalid option', 'Error in usaspeding.gov data')
INSERT INTO oc_perennial.type_of_set_aside
(code, name, description) VALUES
  ('NONE', 'No set aside used.', 'Report this code if the contract award was not a socio-economic program set-aside.'),
  ('SBA', 'Small Business Set Aside - Total', 'Report this code for a small business set aside.'),
  ('SDB', 'Small Disadvantaged Business', 'Deprecated'),
  ('8A', '8A Competed', 'Report this code for an 8a award pursuant to FAR 19.805-2'),
  ('SBP', 'Small Business Set-Aside -- Partial', 'Report this code for a partial small business set aside made pursuant to FAR 19.502-3.'),
  ('HMT', 'HBCU or MI Set-Aside -- Total', 'Report this code for an award directed to a Historically Black College/University or Minority Institution per DFARS 226.7003. This value cannot be selected after 10/13/2014.'),
  ('HMP', 'HBCU or MI Set-Aside -- Partial', 'Report this code for contract awards directed to Historically Black College/University of Minority Institution per DFARS 235.016. This value cannot be selected after 10/13/2014.'),
  ('VSB', 'Very Small Business Set Aside', 'Report this code if the acquisition is between $2,501 and $50,000 and was awarded to a very small business concern as a result of using set-aside procedures under the very small business pilot program set forth in FAR 19.9. This code is valid until 12/08/2004.'),
  ('ESB', 'Emerging Small Business Set-Aside', 'Enter this code if the action was an emerging small business reserve award (set-aside) within a designated industry group under the Small Business Competitiveness Demonstration Program (see FAR Subpart 19.10).'),
