  ('SDVOSBC', 'Service Disabled Veteran Owned Small Business Set-Aside', 'Report this code for contract awards exceeding the micro purchase threshold set-aside for competition restricted to service-disabled veteran-owned small business concerns. FAR.19.1405'),
  ('BI', 'Buy Indian', 'Report this code if applicable. As of 7/8/2013 this value can no longer be used by the Department of Interior. This code can still be used by the Indian Health Service of the Department of Health and Human Services.'),
  ('IEE', 'Indian Economic Enterprise', 'Report this code if applicable. This value can only be used by the Department of Interior. The start date is 7/8/2013.'),
  ('ISBEE', 'Indian Small Business Economic Enterprise', 'Report this code if applicable. This value can only be used by the Department of Interior. The start date is 7/8/2013.'),
  ('HZS', 'HUBZone Sole Source', 'Report this code if the award was made through noncompetitive procedures to a HUBZone small business concern under the authority of FAR 19.1306.'),
  ('SDVOSBS', 'SDVOSB Sole Source', 'Report this code for contract awards exceeding the micro purchase threshold set-aside for non competitive award to service-disabled veteran-owned small business concerns. FAR 19.1406'),
  ('8AN', '8(a) Sole Source', 'Report this code for actions with the Small Business Administration pursuant to FAR 19.8, or directly with an 8(a) contractor pursuant to a memorandum of understanding between the SBA and the reporting agency per 219.811'),
  ('RSB', 'Reserved for Small Business $2501 to 100K (available only pre CLOD)', 'Report this code if awards exceeds the micro-purchase threshold but does not exceed the simplified acquisition threshold. FAR 13. This code is valid until 10/31/2009'),
  ('8AC', 'SDB Set-Aside 8(a)-(Will be deprecated in future)', 'Report this code for a small disadvantaged business award made under a competitive 8(a) preference program pursuant to FAR 19.800(d). This code is not valid for base documents signed after 11/18/2005'),
  ('HS2', 'Combination HUBZone and 8(a)-(Will be deprecated in future)', 'Report this code if the award was a combination HUBZone set-aside and 8(a) award. This code is not valid for base documents signed after 10/02/2008.'),
  ('HS3', '8(a) with HUB Zone Preference', 'Report this code when the primary preference program was 8(a) and priority was given to the 8(a) concern that was also a HUBZone small business concern. See FAR 19.800(d). This code is not valid for base documents signed after 10/02/2008.'),
  ('VSA', 'Veteran Set Aside', 'Report this code for actions with Veteran Owned Businesses'),
  ('VSS', 'Veteran Sole Source', 'Report this code for actions with Veteran Owned Businesses.'),
  ('WOSB', 'Women Owned Small Business', 'Report this code for a Women Owned Small Business Set-Aside made pursuant to FAR 19.15. This code is only valid for actions signed on or after 4/01/2011.'),
  ('WOSBSS', 'Women Owned Small Business Sole Source', 'Report this code for a Women Owned Small Business Sole Source Set-Aside made pursuant to FAR 19.15. This code is only valid for actions signed on or after 4/01/2011.'),
  ('EDWOSBSS', 'Economically Disadvantaged Women Owned Small Business Sole Source', 'Report this code for an Economically Disadvantaged Women Owned Small Business Sole Source Set-Aside made pursuant to FAR 19.15. This code is only valid for actions signed on or after 4/01/2011.'),
  ('EDWOSB', 'Economically Disadvantaged Women Owned Small Business', 'Report this code for an Economically Disadvantaged Women Owned Small Business Set-Aside made pursuant to FAR 19.15. This code is only valid for actions signed on or after 4/01/2011.')
