INSERT INTO oc_perennial.flag
(flag_name, category, display_name, description, link)
VALUES
('aiobflag', 'demographic', 'American Indian owned business', 'A Native American is a member of any of the indigenous people of the Western Hemisphere.', 'http://www.sba.gov/about-offices-content/1/2960'),
('apaobflag', 'demographic', 'Asian-Pacific American owned business', 'Asian-Pacific American'' means persons with origins from Burma, Thailand, Malaysia, Indonesia, Singapore, Brunei, Japan, China, Taiwan, Laos, Cambodia (Kampuchea), Vietnam, Korea, The Philippines, U.S. Trust Territory of the Pacific Islands (Republic of Palau), Republic of the Marshall Islands, Federated States of Micronesia, the Commonwealth of the Northern Mariana Islands, Guam, Samoa, Macao, Hong Kong, Fiji, Tonga, Kiribati, Tuvalu, or Nauru.', ''),
('baobflag', 'demographic', 'Black American owned business', 'Black'' is defined as all persons having origins in any of the black African racial groups not of Hispanic origin.', ''),
('educationalinstitutionflag', 'education', 'Educational institution', 'An Educational Institution is an organization founded and united for the purpose of providing education; it is another name for a school, college, or university.  Specifically to meet the definition of an educational institution in SAM, the institution must meet the requirements of 20 U.S.C. 1001 and include all sub elements of such an institution.', 'http://www.gpo.gov/fdsys/search/pagedetails.action;jsessionid=BQmqPd4RQZQLZXbsgbslKMXK3xB8tFcBMZDvNYBGF6WKQdltyR1B!1309463806!1653718468?st=citation%3A20+USC+1232g&granuleId=USCODE-2011-title20-chap28-subchapI-partA-sec1001&packageId=USCODE-2011-title20'),
('emergingsmallbusinessflag', 'small_business', 'Emerging small business', '', ''),
('federalgovernmentflag', 'government', 'Federal government', 'The United States Federal Government established by the Constitution to govern the constitutional republic of 50 states, one district and the territories that is the United States of America.  It encompasses all Departments and Agencies of the Executive Branch as well as the Legislative and Judicial Branch. A federal government entity may register in SAM to be eligible for contracts, federal financial assistance, or intragovernmental transactions.  It is distinct from the other levels of government (State, Local), Tribal Governments, or Foreign Governments, as well as commercial enterprises.', ''),
('firm8aflag', 'small_business', '8(a) firm', 'An SBA program for small concerns owned by socially and economically disadvantaged persons.  Firms admitted to the program can receive federal contracts designated for 8(a) Business Development Program participants, as well as management and technical assistance.', 'http://www.sba.gov/content/8a-business-development-0'),
('haobflag', 'demographic', 'Hispanic American owned business', 'Hispanic'' means all persons of Mexican, Puerto Rican, Cuban, Central or South American, or other Spanish culture or origin, regardless of race.', ''),
('hbcuflag', 'education', 'Historically Black College or University', 'Historically Black College or University means are institutions determined by the Secretary of Education to meet the requirements of 34 CFR 608.2. For the Department of Defense (DoD), the National Aeronautics and Space Administration (NASA), and the Coast Guard, the term also includes any nonprofit research institution that was an integral part of such a college or university before November 14, 1986.', 'http://ecfr.gpoaccess.gov/cgi/t/text/text-idx?c=ecfr&sid=6a46d8e148e842cc5354b3ed34e37b2e&rgn=div5&view=text&node=34:3.1.3.1.8&idno=34'),
('hospitalflag', 'organization', 'Hospital', 'Hospitals are health care institutions providing patient treatment by specialized staff and equipment. Hospitals often, but not always, provide for inpatient care or longer-term patient stays.', ''),
('hubzoneflag', 'small_business', 'HUBZone', 'The Historically Underutilized Business Zones (HUBZone) program helps small businesses in urban and rural communities gain preferential access to federal procurement opportunities. These preferences go to small businesses that obtain HUBZone certification in part by employing staff who live in a HUBZone. The company must also maintain a ''principal office'' in one of these specially designated areas.', 'http://www.sba.gov/content/hubzone-0'),
('is1862landgrantcollege', 'education', '1862 land grant college', 'Land-Grant Colleges are institutions of higher education in the U.S. designated by each state to receive the benefits of the Morrill Acts of 1862 and 1890.  They are often categorized as 1862, 1890, and 1994 institutions, based on the date of the legislation that designated most of them with land grant status.', ''),
('is1890landgrantcollege', 'education', '1890 land grant college', 'Land-Grant Colleges are institutions of higher education in the U.S. designated by each state to receive the benefits of the Morrill Acts of 1862 and 1890.  They are often categorized as 1862, 1890, and 1994 institutions, based on the date of the legislation that designated most of them with land grant status.', ''),
('is1994landgrantcollege', 'education', '1994 land grant college', 'Land-Grant Colleges are institutions of higher education in the U.S. designated by each state to receive the benefits of the Morrill Acts of 1862 and 1890.  They are often categorized as 1862, 1890, and 1994 institutions, based on the date of the legislation that designated most of them with land grant status.', ''),
('isairportauthority', 'government', 'Airport authority', 'If you choose U.S. Federal, State, Local, Tribal, or Foreign Government entities then you have the options to select your type of Government Entity.  Choose one of these other Governmental Entities if applicable. An airport authority is an independent entity charged with the operation and oversight of an airport or group of airports. These authorities are often governed by a group of airport commissioners, who are appointed to lead the authority by a government official.', ''),
('isalaskannativeownedcorporationorfirm', 'demographic', 'Alaskan native owned corporation or firm', 'The Alaska Native Claims Settlement Act of 1971 allotted 40 million acres of land for division among 12 regional native corporations and 220 village corporations. Alaska natives and descendants born before 1971 were allowed to receive 100 shares in their village corporation and regional corporation. In 1975, a 13th corporation formed to represent Alaska natives residing outside the state. Over the years, some village corporations merged with each other or with their regional corporation. These are known as Alaskan Native Corporations.  In 1986, Congress passed legislation that allowed ANCs to participate in the Small Business Administration''s disadvantaged business program, known as the 8(a) program, which sets aside federal contracts for minority-owned or other disadvantaged companies.', 'http://www.sba.gov/content/alaskan-owned-corporations'),
('isarchitectureandengineering', 'corporate', 'Architecture and engineering', '', ''),
('iscitylocalgovernment', 'government', 'City local government', '', ''),
('iscommunitydevelopedcorporationownedfirm', 'corporate', 'Community developed corporation owned firm', '', ''),
('iscommunitydevelopmentcorporation', 'corporate', 'Community development corporation', 'While there is no established legal definition for Community Development Corporations, they are “defined” by their community-based leadership and community-oriented goals which are, primarily, fostering job creation and access to affordable housing. These community organizations are set up by residents, small business owners, church congregations, members of civic associations, etc. to promote the revitalization of their community in terms of housing and job creation. They also provide a host of different social services to residents in need. Community Development Companies need not be certified by any national entity, although some states require them to meet certain criteria in order to receive state funding. These entities are non-profit institutions organized under section 501 (c) (3) of the federal Internal Revenue code, which designates them as tax-exempt, non-profit organizations. This designation is essential so that the institution may receive grants and gifts from both public and private sources.', 'http://www.sba.gov/community/blogs/community-blogs/small-business-cents/cdcs-and-cdcs-community-development-corporation'),
('isconstructionfirm', 'corporate', 'Construction firm', '', ''),
('iscorporateentitynottaxexempt', 'corporate', 'Corporate entity (not tax exempt)', 'Businesses that pay U.S. Federal Income Taxes or U.S. Possession Income Taxes.', ''),
('iscorporateentitytaxexempt', 'corporate', 'Corporate entity (tax exempt)', 'Corporate Entity Tax Exempt are businesses that does not pay either U.S. Federal Income Taxes or U.S. Possession Income Taxes.', ''),
('iscouncilofgovernments', 'government', 'Council of governments', 'Councils of governments are regional bodies that exist throughout the United States. They are also sometimes called regional councils, regional commissions, regional planning commissions, planning district commissions, and development districts. A typical council is defined to serve an area of several counties, and they address issues such as regional and municipal planning, economic and community development, cartography and GIS, hazard mitigation and emergency planning, aging services, water use, pollution control, transit administration, and transportation planning.', ''),
('iscountylocalgovernment', 'government', 'County local government', '', ''),
('isdomesticshelter', 'organization', 'Domestic shelter', 'A Domestic Shelter is a place of temporary refuge and support for persons escaping violent or abusive situations, such as rape and domestic violence.  Please note that there may be provision to hide or restrict the address of a domestic shelter if that is deemed to be in the best interest of its residents.', ''),
('isdotcertifieddisadvantagedbusinessenterprise', 'demographic', 'DOT certified disadvantaged business enterprise', 'The Department of Transportation (DOT) Disadvantaged Business Enterprise (DBE) program is implemented by recipients of DOT Federal Financial Assistance. Recipients are primarily state highway, transit and airport agencies that receive funds subject to Title 49 Code of Federal Regulations parts 26 (49 CFR 26). This is not the same as the SBA Small Business Certification. Select this box if your business is certified by a state certifying agency as a DOT DBE.', 'http://osdbuweb.dot.gov/DBEProgram/'),
('isecondisadvwomenownedsmallbusiness', 'demographic', 'Economically disadvantaged women-owned small business', 'An Economically Disadvantaged Women-Owned Small Business (EDWOSB) is a company that is a Women-Owned Small business (WOSB) is at least 51 percent owned by one or more women who are ''economically disadvantaged.'' However, SBA may waive this requirement of economic disadvantage for industries in which WOSBs are ''substantially underrepresented.'' A woman is presumed economically disadvantaged if she has a personal net worth of less than $750,000 (with some exclusions), her adjusted gross yearly income averaged over the three years preceding the certification is less than $350,000, and the fair market value of all her assets is less than $6 million (with some exclusions).', 'http://www.sba.gov/content/women-owned-small-business-program'),
('isfederalgovernmentagency', 'government', 'Federal government agency', '', ''),
('isfederallyfundedresearchanddevelopmentcorp', 'government', 'Federally funded research and development corporation', '', ''),
('isforeigngovernment', 'government', 'Foreign government', 'The government of a country other than the United States of America. A Foreign Government entity may register in SAM to be eligible for contracts or federal financial assistance. It is distinct from the United States Government and Tribal Governments, as well as commercial enterprises.', ''),
('isforeignownedandlocated', 'corporate', 'Foreign-owned and located', 'An organization that is not owned by an organization incorporated in the United States.', ''),
('isforprofitorganization', 'corporate', 'For-profit organization', 'A For-Profit Organization is one that distributes any profit not reinvested into the business as profit or dividends to its employees or shareholders.', ''),
('isfoundation', 'organization', 'Foundation', 'A Foundation (also a charitable foundation) is a legal categorization of nonprofit organizations that will typically either donate funds and support to other organizations, or provide the source of funding for its own charitable purposes.', ''),
('ishispanicservicinginstitution', 'demographic', 'Hispanic servicing institution', 'Hispanic-Serving Institutions (HSI) are institutions of higher education that have an enrollment of undergraduate full-time equivalent students that is at least 25 percent Hispanic students at the end of the award year immediately preceding the date of application.', ''),
('ishousingauthoritiespublicortribal', 'government', 'Housing authority (public or tribal)', 'A housing authority is generally a governmental body that governs some aspect of the territory''s housing, often providing low rent or free apartments to qualified residents.', ''),
('isindiantribe', 'government', 'Indian tribe', 'Indian Tribe means any Indian tribe, band, pueblo, or community, including native villages and native groups (including corporations organized by Kenai, Juneau, Sitka, and Kodiak) as defined in the Alaska Native Claims Settlement Act, that is recognized by the Federal Government as eligible for services from BIA in accordance with 25 U.S.C. 1452(c).', 'http://www.gpo.gov/fdsys/pkg/USCODE-2011-title25/pdf/USCODE-2011-title25.pdf'),
('isintermunicipallocalgovernment', 'government', 'Inter-municipal local government', '', ''),
('isinternationalorganization', 'organization', 'International organization', 'International Organization is any public international organization entitled to enjoy privileges, exemptions, and immunities as an international organization under the International Organizations Immunities Act (22 U.S.C. 288-288(f)). In general, to qualify as an international organization, the United States must participate in the organization pursuant to a treaty or under the authority of an Act Congress authorizing such participation.', 'http://www.irs.gov/pub/irs-pdf/iw8exp.pdf'),
('isinterstateentity', 'government', 'Interstate entity', 'An interstate entity is a governmental agency formed through an agreement between two or more states of the United States of America. Frequently, these entities are responsible for administering or improving some shared resource such as a seaport or public transportation infrastructure.', ''),
('isjointventureecondisadvwomenownedsmallbusiness', 'demographic', 'Joint venture economically disadvantaged women-owned small business', 'Joint Venture Economically Disadvantaged Women-Owned Small Business (EDWOSB) concern means a joint venture that complies with the requirements of 13 CFR part 127 and certifies it is an EDWOSB.', 'http://www.sba.gov/sites/default/files/files/Contracting%20Officers%20WOSB%20Compliance%20Guide_Jan2011.pdf'),
('isjointventurewomenownedsmallbusiness', 'demographic', 'Joint venture women owned small business', 'Joint Venture Women-Owned Small Business (WOSB) Concern means a joint venture that complies with the requirements of 13 CFR part 127 and certifies it is a WOSB.', 'http://ecfr.gpoaccess.gov/cgi/t/text/text-idx?c=ecfr&sid=90eeaae64537dfafee0a04f4d564b3cb&rgn=div5&view=text&node=13:1.0.1.1.22&idno=13'),
('islaborsurplusareafirm', 'corporate', 'Labor surplus area firm', '', ''),
('islimitedliabilitycorporation', 'corporate', 'Limited Liability Corporation', 'A Limited Liability Company (LLC) is a business structure allowed by state statute. LLCs are popular because, similar to a corporation, owners have limited personal liability for the debts and actions of the LLC. Other features of LLCs are more like a partnership, providing management flexibility and the benefit of pass-through taxation.', 'http://www.irs.gov/businesses/small/article/0,,id=98277,00.html'),
('islocalgovernmentowned', 'government', 'Local government owned', '', ''),
('ismanufacturerofgoods', 'general', 'Manufacturer of goods', 'These organizations manufacture goods as opposed to being a service provider.', ''),
('ismunicipalitylocalgovernment', 'government', 'Municipality local government', '', ''),
('isnativehawaiianownedorganizationorfirm', 'demographic', 'Native Hawaiian owned organization or firm', 'Native Hawaiian Organization means any community service organization serving Native Hawaiians in the State of Hawaii which is a not-for-profit organization chartered by the State of Hawaii, is controlled by Native Hawaiians, and whose business activities will principally benefit such Native Hawaiians.', 'http://www.gpo.gov/fdsys/pkg/CFR-2006-title13-vol1/html/CFR-2006-title13-vol1.htm'),
('isotherbusinessororganization', 'corporate', 'Other business organization', '', ''),
('isotherminorityowned', 'demographic', 'Other minority owned', '', ''),
('isothernotforprofitorganization', 'organization', 'Other not-for-profit organization', 'Other not for profit organizations are those organizations that are not profit making but also do not qualify as a nonprofit under Internal Revenue Code 501(c ).', ''),
('ispartnershiporlimitedliabilitypartnership', 'corporate', 'Partnership or LLP', 'A Partnership is the relationship existing between two or more persons who join to carry on a trade or business. Each person contributes money, property, labor or skill, and expects to share in the profits and losses of the business. A partnership must file an annual information return to report the income, deductions, gains, losses, etc., from its operations, but it does not pay income tax. Instead, it "passes through" any profits or losses to its partners. Each partner includes his or her share of the partnership''s income or loss on his or her tax return. A Limited Liability Company (LLC) is a business structure in which owners have limited personal liability for the debts and actions of the LLC. LLCs with multiple owners that do not elect to be taxed as a corporation are taxed as a partnership and are generally called Limited Liability Partnerships (LLP).', 'http://www.irs.gov/businesses/small/article/0,,id=98214,00.html and http://www.irs.gov/businesses/small/selfemployed/article/0,,id=205014,00.html'),
('isplanningcommission', 'government', 'Planning commission', 'A planning commission is a commission delegated to propose plans for future activities and developments, generally on behalf of a government entity.', ''),
('isportauthority', 'government', 'Port authority', 'In Canada and the United States a port authority (less commonly a port district) is a governmental or quasi-governmental public authority for a special-purpose district usually formed by a legislative body (or bodies) to operate ports and other transportation infrastructure.', ''),
('isprivateuniversityorcollege', 'education', 'Private university or college', 'Private universities are universities not operated by governments, although many receive public subsidies, especially in the form of tax breaks and public student loans and grants. Depending on their location, private universities may be subject to government regulation. This is in contrast to public universities and national universities. While many prominent private universities are run by charitable or non-profit organizations, a subset are commercial for-profit universities which are run as business organizations.', ''),
('issbacertifiedsmalldisadvantagedbusiness', 'small_business', 'SBA Certified Small Disadvantaged Business', 'The firm must be 51 percent or more owned and control by one or more disadvantaged persons. The disadvantaged person or persons must be socially disadvantaged and economically disadvantaged.The firm must be small, according to the Small Business Administration’s size standards.', ''),
('isschooldistrictlocalgovernment', 'government', 'School district local government', '', ''),
('isschoolofforestry', 'education', 'School of forestry', 'A School of Forestry is a professional school that offers forestry instruction, including emphases on biodiversity and conservation sciences.', ''),
('isserviceprovider', 'corporate', 'Service provider', '', ''),
('issmallagriculturalcooperative', 'small_business', 'Small agricultural cooperative', 'A Small Agricultural Cooperative is an association (corporate or otherwise) acting pursuant to the provisions of the Agricultural Marketing Act (12 U.S.C.A. 1141j) whose size does not exceed the size standard established by SBA for other similar agricultural small business concerns.', 'http://www.sbaonline.sba.gov/contractingopportunities/owners/glossary/index.html'),
('issoleproprietorship', 'small_business', 'Sole proprietorship', 'A sole proprietor is someone who owns an unincorporated business by himself or herself.', 'http://www.irs.gov/businesses/small/article/0,,id=98202,00.html'),
('isstatecontrolledinstitutionofhigherlearning', 'education', 'State-controlled institution of higher learning', 'A state university system in the United States is a group of public universities supported by an individual state, or a similar entity such as the District of Columbia.  These systems constitute the majority of public-funded universities in the country. Each state supports at least one such system.', ''),
('issubchapterscorporation', 'corporate', 'Subchapter S corporation', 'Subchapter S Corporations are corporations that elect to pass corporate income, losses, deductions and credit through to their shareholders for federal tax purposes.', 'http://www.irs.gov/businesses/small/article/0,,id=98263,00.html'),
('istownshiplocalgovernment', 'government', 'Township local government', '', ''),
('istransitauthority', 'government', 'Transit authority', 'A transit authority is a government agency created for the purpose of providing public transportation within a specific region.  In the United States, this is usually within one state, but in rare circumstances may cover two or more states. Also known as a transit district.  A transit authority is created to give it the power of the government in dealing with solving problems related to transit issues. This includes the powers of eminent domain to obtain space for rights of way (e.g. for railways or busways), the ability to impose excise, income, property, and/or sales taxes to fund subsidies of operating costs of local transportation, and the ability to operate independently of the cities and counties that the transit district operates within. A transit district may also have its own transit police force, although in some areas the local police provide a special bureau for this purpose.  A transit district may operate bus, rail or other types of transport including ferry service, or may operate other facilities. In some cases, the transit district may be part of a larger organization such as a state Department of Transportation.', ''),
('istribalcollege', 'education', 'Tribal college', 'Tribal Colleges are institutions of higher education that (1) qualify for funding under the Tribally Controlled Colleges and Universities Assistance Act of 1978 (25 U.S.C. 1801 et seq.) or the Navajo Community College Act (25 U.S.C. 640a note); or (2) are cited in section 532 of the Equity in Educational Land-Grant Status Act of 1994 (7 U.S.C. 301 note).', ''),
('istriballyownedfirm', 'government', 'Tribally owned firm', 'A Tribally-Owned Firm refers here to a firm owned by a Native American Tribe.', 'http://www.gpo.gov/fdsys/pkg/USCODE-2011-title25/pdf/USCODE-2011-title25.pdf'),
('isveterinarycollege', 'education', 'Veterinary college', 'A veterinary school is a tertiary educational institution, or part of such an institution, which is involved in the education of veterinarians, and provides a veterinary degree (i.e.: DVM, VMD, etc.) to qualified graduates.', ''),
('isveterinaryhospital', 'education', 'Veterinary hospital', '', ''),
('iswomenownedsmallbusiness', 'demographic', 'Women-owned small business', 'Women-Owned Small Business (WOSB) concern eligible under the WOSB Program (in accordance with 13 CFR part 127), means a small business concern that is at least 51 pecent owned and controlled by one or more women, and primarily managed by one or more women. The women must be U.S. citizens. The firm must be “small” in its primary industry in accordance with SBA’s size standards for that industry.', 'http://www.sba.gov/content/women-owned-small-business-program'),
('localgovernmentflag', 'government', 'Local government', 'A government of a locality (city, county, etc) within one of the 50 states that make up the United States of America.  A Local Government entity may register in SAM to be eligible for contracts or federal financial assistance.  It is distinct from the other levels of government (Federal, State), Tribal Governments, or Foreign Governments, as well as commercial enterprises.', ''),
('minorityinstitutionflag', 'education', 'Minority institution', 'Minority Institutions are institutions of higher education meeting the requirements of Section 365(3) of the Higher Education Act of 1965 (20 U.S.C. 1067k), including a Hispanic-serving institution of higher education, as defined in Section 502(a) of the Act (20 U.S.C. 1101a).', 'http://www.gpo.gov/fdsys/pkg/USCODE-2011-title20/pdf/USCODE-2011-title20.pdf'),
('minorityownedbusinessflag', 'demographic', 'Minority owned business', 'A minority business is defined as a business in which more than 51 percent of the interest, stock and otherwise, is owned by minority group members. Subcategories include Asian-Pacific American owned, Subcontinent Asian (Asian-Indian) owned, Black American owned, Hispanic American owned, Native American owned, or Other.', ''),
('naobflag', 'demographic', 'Native American owned business', 'Native American'' means American Indians, Eskimos, Aleuts, or Native Hawaiians.', ''),
('nonprofitorganizationflag', 'organization', 'Non-profit organization', 'A Nonprofit Organization is an organization that uses its surplus revenues to achieve its goals rather than distribute them as profit or dividends.  The IRS defines this status under Internal Revenue Code 501(c).', ''),
('receivescontracts', 'general', 'Recieves contracts', '', ''),
('receivescontractsandgrants', 'general', 'Receives contracts and grants', '', ''),
('receivesgrants', 'general', 'Receives grants', '', ''),
('saaobflag', 'demographic', 'Subcontinent Asian (Asian-Indian) American owned business', 'Subcontinent Asian (Asian-Indian) American'' means persons with origins from India, Pakistan, Bangladesh, Sri Lanka, Bhutan, the Maldives Islands, or Nepal.', ''),
('sdbflag', 'small_business', 'Small Disadvantaged Business', 'The firm must be 51 percent or more owned and controlled by one or more disadvantaged persons. The disadvantaged person or persons must be socially disadvantaged and economically disadvantaged. The firm must be small, according to the Small Business Administration’s size standards.', ''),
('shelteredworkshopflag', 'organization', 'Sheltered workshop', 'Also known as a ''work center'', centers that have historically provided rehabilitation services, day treatment, training, and/or employment opportunities to individuals with disabilities.', ''),
('srdvobflag', 'demographic', 'Service-related disabled veteran owned business', 'Service Disabled Veteran Owned Business means a business that (i) not less than 51 percent of which is owned by one or more service-disabled veterans or, in the case of any publicly owned business, not less than 51 percent of the stock of which is owned by one or more service-disabled veterans; and (ii) the management and daily business operations of which are controlled by one or more service-disabled veterans or, in the case of a service-disabled veteran with permanent and severe disability, the spouse or permanent caregiver of such veteran.  “Service-disabled veteran” means a veteran, as defined in 38 U.S.C. 101(2), with a disability that is service-connected, as defined in 38 U.S.C. 101(16).', 'http://www.gpo.gov/fdsys/pkg/USCODE-2011-title38/pdf/USCODE-2011-title38.pdf'),
('stategovernmentflag', 'government', 'State government', 'A government of one of the 50 states that make up the United States of America.  A state government entity may register in SAM to be eligible for contracts or federal financial assistance.  It is distinct from the other levels of government (Federal, Local), Tribal Governments, or Foreign Governments, as well as commercial enterprises.', ''),
('tribalgovernmentflag', 'government', 'Tribal government', 'The independent government of an indigenous tribe within the borders of the United States of America that has local sovereignty as a tribal nation. A Tribal Government entity may register in SAM to be eligible for contracts or federal financial assistance.  It is distinct from the other levels of government (Federal, Local, and State) and Foreign Governments, as well as commercial enterprises.', ''),
('veteranownedflag', 'demographic', 'Veteran owned business', 'A business that (1) not less than 51 percent of which is owned by one or more veterans or, in the case of any publicly owned business, not less than 51 percent of the stock of which is owned by one or more veterans; and (2) the management and daily business operations of which are controlled by one or more veterans.', 'http://www.gpo.gov/fdsys/pkg/USCODE-2011-title38/pdf/USCODE-2011-title38.pdf'),
('womenownedflag', 'demographic', 'Women-owned business', 'Women-Owned Business means a business (1) that is at least 51 percent owned by one or more women; or, in the case of any publicly owned business, at least 51 percent of the stock of which is owned by one or more women; and (2) whose management and daily business operations are controlled by one or more women.', '')
